// -------------------- This Model Retrieves The User's Type From The Server's Cache And Returns It -------------------- //

import axios from 'axios';

export const getUserTypeFromServerCache: any = async () => {

    // Attempting to get The user's type From The Server's Cache
    try {

        const response = await axios.post('http://localhost:3001/users/type');
        const userTypeFromServerCache = response.data;

        return userTypeFromServerCache;
    }

    catch (error) {

        return "";
    }
}
